INSERT INTO `produkty_popis` (`produktId`, `cz`, `en`, `ge`, `created`, `updated`) VALUES
	(133, 'Pilka zahradní FISKARS Xtract L 1000614 je vhodná k řezání čerstvého dřeva. Pilka má unikátní vysouvací mechanismus s integrovanou karabinou na opasek a pohodlné a bezpečné držadlo SoftGripTM, které ochrání vaše prsty \npřed jejich sklouznutím na čepel. Pilka FISKARS vám snadno umožní řezat větve a prosvětlovat koruny stromů.', NULL, NULL, '2021-07-19 09:54:53', '2021-07-19 09:54:53'),
	(134, 'Jednočepelové převodové nůžky na silné větve FISKARS 1000583 jsou vhodné pro střihání větví o průměru až 50 mm. Nůžky mají unikátní převod PowerGear™, který zvyšuje střižný výkon a rovnoměrně rozděluje sílu v celém průběhu střihu.', NULL, NULL, '2021-07-19 09:54:53', '2021-07-19 09:54:53'),
	(135, 'Nůžky zahradní univerzální FISKARS 1001558 jsou víceúčelovým nástrojem s vynikajícím dosahem do korun stromů a hustých keřů. Můžete s nimi bezpečně stříhat ve výškách bez potřeby žebříku nebo naopak u země, aniž byste se museli sklánět. Unikátní mechanismus umožňuje stříhat s vynaložením 12x menší síly než u nůžek s tradičním mechanismem. Střihací hlava je nastavitelná v rozsahu 230°. Práce s nůžkami FISKARS je vždy rychlá, snadná a bezpečná.', NULL, NULL, '2021-07-19 09:54:53', '2021-07-19 09:54:53'),
	(158, 'Nůžky zahradní dvoučepelové FISKARS SingleStep 1000567 jsou vhodné pro stříhání mladého, čerstvého dřeva. Vrchní čepel nůžek je potažená kluznou vrstvou PTFE, která usnadňuje stříhání i čištění. Čepele jsou vyrobeny z kvalitní karbonové oceli. Masivní držadla poskytují pohodlný a \npevný stisk, dobře vyvážený design nůžek zas zaručuje co nejpohodlnější práci.', NULL, NULL, '2021-07-19 09:54:53', '2021-07-19 09:54:53'),
	(159, 'Nůžky zahradní profesionální \nFISKARS 1001530 mají čepel z neobyčejně kvalitní kalené karbonové oceli, která zůstává i \npo dlouhodobém používání ostrá. Čepele \nzahradních nůžek jsou bočně vyztužené a neoddalují se od sebe ani po stříhání silných větví. Zahradní nůžky FISKARS mají regulovatelný přítlak čepelí se zámkem, který \nzajišťuje přesné stříhání.', NULL, NULL, '2021-07-19 09:54:53', '2021-07-19 09:54:53'),
	(165, 'Nůžky zahradní dvoučepelové FISKARS Fingerloop 1001534 jsou vhodné pro stříhání čerstvého dřeva. Vrchní \nčepel je potažena kluznou vrstvou PTFE, která usnadňuje střihání i čištění. Čepele jsou vyrobeny z nerezové oceli, držadla z materiálu FiberCompTM, který poskytuje bezpečný a pohodlný úchop. Spodní držadlo ve tvaru oka chrání prsty během střihu.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(166, 'Zahradní nůžky převodové dvoučepelové FISKARS 1000573 mají ergonomicky tvarovaná držadla zhotovená z extra pevného polyamidu vyztuženého skelnými vlákny. Čepele zahradních nůžek jsou vyrobeny z pečlivě zakalené nerezové oceli a v nepracovní poloze jsou bezpečně kryty pomocí jednoduchého uzamykatelného zámku.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(167, 'Pilka zahradní FISKARS Xtract S 1000613 je určená k řezání čerstvých větví o průměru do 120 mm. Pilka má unikátní vysouvací mechanismus s integrovanou karabinou na opasek a pohodlné a bezpečné držadlo SoftGripTM, které ochrání vaše prsty před jejich sklouznutím na čepel. Pilka FISKARS vám snadno umožní řezat větve a prosvětlovat koruny stromů.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(168, 'Pilka prořezávací na větve FISKARS 1001561 je speciálním příslušenstvím pro univerzální zahradní nůžky a teleskopické zahradní nůžky FISKARS 1001558, 1001557 a 1000598. Pilka má nastavitelný úhel řezu.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(175, 'Nástavec prodlužovací FISKARS 1001560 umožňuje prodloužit dosah stříhání až do výšky 5 m. Nástavec je vyrobený z hliníku a je velmi lehký. Lze ho připojit k zahradním nůžkám FISKARS 1001558 a \n1001557.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(176, 'Nůžky na květiny FISKARS 1001544 jsou vhodné na zastřihávání rostlin a výhonů, ale i zahradních drátků. Extra tvrdé čepele jsou vyrobeny z karbonové \noceli a držadla z nárazuvzdorného plastu PBT. Držadla jsou navrženy tak, aby vyhovovala přirozenému pohybu ruky. Zoubkovaná spodní čepel zabraňuje květinám nebo rostlinám sjíždět dopředu.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(179, 'Zahradní převodové dvoučepelové nůžky FISKARS 1000574 mají ergonomicky tvarovaná držadla vyrobená z extra pevného polyamidu vyztuženého skelnými vlákny. Čepele nůžek FISKARS jsou zhotoveny z kvalitní kalené nerezové oceli, které mají jednoduchý bezpečnostní zámek jako ochranu před pořezáním.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(180, 'Nůžky jednočepelové zahradní \nFISKARS 1000575 jsou vhodné k zastřihávání výhonů a větví. Zahradní nůžky umožňují střih v několika krocích v závislosti na tloušťce větve a s ohledem na nenáročnost práce. Držadla zahradních nůžek jsou zhotoveny \nz materiálu FiberCompTM s neklouzavým povrchem, čepel z karbonové oceli potažené nepřilnavou vrstvou. ', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(181, 'Nůžky převodové \nna silné větve FISKARS 1002104 o velikosti S jsou vhodné pro všechny druhy střihání v zahradě až \ndo průměru větví 38 mm. Zahradní nůžky \nmají unikátní převod PowerGear™ zvyšující střižný výkon. Čepel je vyrobena z kalené nerez oceli s dlouhou trvanlivostí, rukojeť z kompozitního materiálu FiberComp™ zaručující vysokou pevnost.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(182, 'Dvouruční nůžky převodové na silné větve FISKARS M 1000582 jsou určeny pro stříhání keřů a větví stromů o průměru do 38 mm. Unikátní převod PowerGear™ zvyšuje střižný výkon \na rovnoměrně rozděluje sílu po celou dobu střihu. Držadla zahradních nůžek jsou vyrobena z kompozitního materiálu FiberComp™, čepele z nerezové oceli CrMoV o vysoké tvrdosti. Zahradní nůžky mají \npohodlné uchopení pro snadnou práci.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(184, 'Převodové nůžky na silné větve FISKARS 1000584 jsou vhodné pro všechny druhy střihání v zahradě až do průměru větví 50 mm. Nůžky mají unikátní \npřevod PowerGear™, který zvyšuje střižný výkon a rovnoměrně rozděluje sílu v celém průběhu střihu.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(185, 'Dvouruční nůžky jednočepelové na silné větve FISKARS 1000585 jsou vhodné k zastřihávání výhonů a \nvětví o průměru do 40 mm. Zahradní nůžky umožňují střih v několika krocích v závislosti na tloušťce větve a s ohledem na nenáročnost práce. Držadla zahradních nůžek jsou zhotoveny z materiálu FiberCompTM s neklouzavým povrchem, čepel z karbonové oceli potažené nepřilnavou vrstvou. Zahradní nůžky FISKARS usnadňují stříhání tvrdého, suchého dřeva.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(186, 'Nůžky na trávu dlouhé FISKARS \nServo-System 1000590 jsou určeny pro zastřihávání okrajů trávníku. Díky důmyslnému mechanismu zahradní nůžky trávu nikdy nežvýkají a umožňují práci ve vpřímené \npoloze. Čepele jsou vyrobeny z kvalitní zakalené švédské chromové oceli a mají dlouhou životnost. Úhel střihu lze nastavit v rozmezí 360°. Nůžky mají lehká a pevná držadla. Účinný mechanismus zvyšuje střižnou sílu.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(187, 'Nůžky \nna živý plot s oboustranným převodem FISKARS 1001563 jsou vhodné pro zastřihávání živých \nplotů a keřů. Zahradní nůžky mají patentovaný mechanismus PowerGearTM, který zvyšuje střižnou sílu. Čepel je vyrobena z kalené nerezové oceli s dlouhou trvanlivostí, rukojeť z kompozitního materiálu FiberCompTM s vysokou pevností. Čepel zahradních nůžek zůstává i po dlouhodobém používání stále ostrá. Pružné dorazy chrání svaly na rukou.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(189, 'Nůžky zahradní univerzální prodloužené FISKARS 1001557 jsou víceúčelovým nástrojem s vynikajícím dosahem do korun stromů a hustých keřů. Můžete s nimi bezpečně stříhat ve výškách bez potřeby žebříku nebo naopak \nu země, aniž byste se museli sklánět. Unikátní mechanismus umožňuje stříhat s vynaložením 12x menší síly než u nůžek s tradičním mechanismem. Střihací hlava je nastavitelná v \nrozsahu 230°. Práce s nůžkami FISKARS je vždy rychlá, snadná a bezpečná.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(190, 'Nůžky zahradní univerzální teleskopické FISKARS 1000598 jsou víceúčelovým nástrojem s vynikajícím dosahem do korun stromů a hustých keřů. Můžete s nimi bezpečně stříhat ve výškách \nbez potřeby žebříku nebo naopak u země, aniž \nbyste se museli sklánět. Unikátní mechanismus umožňuje stříhat s vynaložením 12x menší síly než u nůžek s tradičním mechanismem. Střihací hlava je nastavitelná v rozsahu 230°. Práce s nůžkami FISKARS je vždy rychlá, snadná a bezpečná.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(192, 'Klín štípací velký FISKARS 1000600 z kované oceli je spirálově stočený, díky čemuž dřevo snadněji praskne i bez použití více klínů. Horní část klínu FISKARS má zakulacené hrany, které zamezují odlétávání \nstřepin. Klín je opatřen vruby proti vyklouznutí.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(193, 'Palice XL FISKARS 1001431 je díky své hmotnosti velice účinná při jakémkoliv zatloukání. Zaoblené hrany kolem pracovní plochy brání vzniku otřepů a snižují nebezpečí odlétnutí špony. Gumový chránič snižuje vibrace při špatném úderu. Jádro topůrka je vyztuženo skelnými vlákny a potaženo měkkým povrchem, který tlumí rázy. Kovaná a kalená karbonová ocel.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(202, 'Zahradnický nůž žabka FISKARS 1001623 slouží k řezání a úpravě dřevin a dalších rostlin. Čepel nože je vyrobena z vysoce kvalitní \nnerezové oceli, držadlo z pevného recyklovaného plastu s mosaznými nýty.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(203, 'Roubovací nůž FISKARS 125890 je určený k roubování, řezání a na úpravu rostlin. Nůž má čepel z vysoce kvalitní karbonové oceli a držadlo z recyklovatelného plastu s mosazným nýtem.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(205, 'Rýč skládací ARMY FISKARS 1000621 je vyroben z kalené \nbórové oceli, tvrzeného hliníku a plastu, a dodáván v šitém pouzdru pro bezpečné skladování a ochranu. Skládací rýč je praktický pro kemping, sport a jiné volnočasové aktivity. Lze ho použít nejen jako rýč, ale také jako motyku.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(206, 'Rýč teleskopický \nšpičatý FISKARS SmartFit 1001567 má špičatou a ostrou pracovní část vhodnou na provzdušňování, rýpání a obracení zeminy. Nastavitelná délka násady slouží pro optimální přizpůsobení uživateli a různé pracovní \nčinnosti. Celý teleskopický systém je velmi jednoduchý. Násada rýče FISKARS je s čepelí spojena pevně a použitá bórová ocel vykazuje vysokou pevnost a tuhost.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(207, 'Rýč teleskopický rovný FISKARS SmartFit 1000620 lze jednoduše přizpůsobit na míru každému uživateli, aby mohl pracovat v co nejpohodlnější poloze. Rýč je velmi lehký a přitom velmi tuhý a odolný, vyrobený z kvalitních materiálů. Rovná a ostrá pracovní část čepele z bytelné oceli je vhodná především pro sázení a přesazování.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(208, 'Rýč zahradní rovný FISKARS Ergonomic 1001411 je vynikající pomocník při sázení, hloubění děr, zarovnávání trávníků a nakládání. Pracovní část je vyrobena z kvalitní bórové oceli zajišťující \nmaximální pevnost a životnost. Rýč ma plastový potah násady, který poskytuje pohodlný úchop. Optimální úhel mezi násadou a čepelí minimalizuje únavu zad, rukou a zápěstí.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(209, 'Rýč zahradní špičatý FISKARS Ergonomic 1001568 je určený k rytí \nv těžkých a kamenitých půdách. Velmi snadno \nproniká zemí i kořeny. Optimální úhel mezi násadou a čepelí minimalizuje únavu zad, rukou a zápěstí. Násada rýče je potažená plastem a poskytuje pohodlné držení. Pracovní část je z kvalitní bórové oceli, která zajišťuje maximální pevnost.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(214, 'Lehké zahradní hrábě FISKARS 1000652 jsou vhodné na úpravu povrchu záhonů. Hrábě mají 14 \nzubů z nerezové oceli a násadu z tvrzeného hliníku potaženou měkkým plastem v místě uchopení. Násada má rozšířené zakončení \npro pohodlné uchopení.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(215, 'Násada teleskopická FISKARS QuikFit 1000666 ve spojení se zahradním nářadím FISKARS QuikFitTM je speciálně navržená pro dosažení do výšek až 4 m. Násada má dvojitý zámek pro bezpečné \npoužití. Je vyrobena z hliníku a má nízkou hmotnost.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(243, 'Vidle teleskopické rycí FISKARS SmartFit 1000630 jsou skvělým nástrojem na obracení hnoje nebo rytí půdy. Slouží také pro pohodlné přemisťování drnů při zarovnávání nebo sázení \na k provzdušňování zeminy nebo vyhrabávání kamenů. Vidle FISKARS mají kvalitní hroty, které snadno proniknou do země. Délku vidlí lze rychle nastavit a přizpůsobit tak nástroj pro uživatele a různé pracovní činnosti.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(244, 'Vidle rycí FISKARS Ergonomic 1001413 jsou vhodné k provzdušňování nebo vybírání kamenů a plevele. Pracovní část je vyrobena z kvalitní bórové oceli, která zajišťuje maximální pevnost. Vidle mají pevné hroty pro snadné pronikání do půdy. Optimální \núhel mezi násadou a čepelí minimalizuje únavu zad, rukou a zápěstí. Plastový potah násady vidlí poskytuje prozměnu pohodlný úchop.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(245, 'Hrábě na listí kovové FISKARS QuikFit 1000644 jsou vhodné k hrabání mechu a trávy z trávníků po sekání. Hrábě FISKARS mají \n20 pružných kovových prstů. K hrábím je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(246, 'Hrábě FISKARS QuikFit 1000653 jsou určeny na hrabání a vyrovnávání záhonů. Hrábě mají 14 hrotů z kvalitní \nkalené oceli. K hrábím je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(247, 'Násada Graphite FISKARS QuikFit 1000661 je vyrobena z tvrzeného hliníku s měkkým plastovým potahem SoftGripTM v místě uchopení \npro maximální pohodlí. Násada je určena pro připojení zahradního nářadí FISKARS QuikFitTM. Násada má unikátní zámek, který umožňuje výměnu nástavce během několika vteřin, a závěsné očko pro skladování.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(248, 'Motyčka se 3 hranami FISKARS QuikFit 1000682 je vhodná pro práci na záhonech v úzkých místech. Motyčka je naostřena \nze tří stran a umožňuje použití pod různými úhly. Pracovní část je vyrobena z kalené bórové oceli. K motyčce je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(249, 'Lopatka FISKARS Solid 1000694 je určena pro \nkypření, sázení, přesazování a hnojení na zahradě. Lopatka je vyrobena z pevného polyamidu vyztuženého skelnými vlákny a má ergonomicky tvarované držadlo. Skvěle odolává extrémním teplotám v rozmezí -40°až +150°a je 100% recyklovatelná. Zaoblené hrany nepoškozují půdu ani kořínky a čepele lze kdykoliv naostřit. Lopatka FISKARS je velmi trvanlivá a snadno se čistí. Násada má otvor \npro zavěšení nářadí v době nečinnosti.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(250, 'Lopatka přesazovací FISKARS Solid 1000695 je určena pro kypření, sázení, přesazování a hnojení na zahradě. Lopatka je vyrobena z pevného polyamidu vyztuženého skelnými vlákny a má ergonomicky tvarované držadlo. Skvěle odolává teplotám v rozmezí -40°až +150°a je 100% recyklovatelná. Zaoblené hrany nepoškozují půdu ani kořínky. Čepel lze kdykoliv naostřit. Lopatka FISKARS je velmi trvanlivá a snadno se čistí. V násadě má otvor pro zavěšení \nnářadí v době nečinnosti.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(251, 'Motyčka FISKARS Solid 1001601 je určená pro sázení, přesazování, okopávání a hnojení na zahradě. Je vyrobena z pevného \npolyamidu vyztuženého skelnými vlákny a je tak velmi trvanlivá a odolná. Skvěle odolává i extrémním teplotám v rozmezí -40°až +150° a je 100% recyklovatelná. Motyčka FISKARS má zaoblené hrany, které nepoškozují půdu ani kořínky. Její čepele lze navíc kdykoliv naostřit. V násadě má otvor pro zavěšení nářadí v době nečinnosti.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(252, 'Motyčka dvoustranná FISKARS QuikFit 1000735 je určená k okopávání rostlin, k provdzušňování půdy a odstranění plevelů. Čepel je vyrobena z bórové oceli. K motyčce je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(253, 'Lopata na sníh FISKARS 141000 je určená k rychlému úklidu sněhové nadílky. Je velmi lehká, má ergonomicky tvarované držadlo a pracovní část ze speciálního plastu se zpevněnou hranou. Mokrý sníh se na lopatu nelepí. Nový a vylepšený tvar pracovní části usnadňuje manipulaci s lopatou.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(256, 'Shrnovač na sníh profesionální FISKARS 1001631 slouží pro efektivní a rychlé odklízení sněhu. Shrnovač má držadlo z ocelové trubky, pracovní část opatřenou pozinkovanou ocelovou lištou a bezpečnostní odrazky. Pracovní část je vyrobena ze zesíleného polypropylénu. Držadlo je \nergonomicky navržené pro co největší pohodlí \npři práci.', NULL, NULL, '2021-07-19 09:54:54', '2021-07-19 09:54:54'),
	(257, 'Shrnovač \nna sníh FISKARS 1001636 má lehkou hliníkovou násadu s ergonomickým plastovým potahem a tvarovaným držadlem. Pracovní část shrnovače na sníh je vyrobena z tvrzeného hliníku.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(301, 'Rámová pila 21" FISKARS 1001621 je vhodná k řezání tlustých větví a prken o průměru do 20 cm. Zuby pilky mají speciální výbrus, díky kterému řeže pila oběma směry. Tvar rámu umožňuje řezat i v méně pohodlné poloze. Pilku FISKARS dodáváme s plastovým krytem pilového listu pro bezpečné přenášení.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(302, 'Pila rámová 24" FISKARS 1000615 je vhodná k řezání tlustých větví a prken o průměru do 20 cm. Zuby pilky mají speciální výbrus, díky kterému řeže pila \noběma směry. Tvar rámu umožňuje řezat i v méně pohodlné poloze. Pilku FISKARS dodáváme s plastovým krytem pilového listu pro bezpečné přenášení.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(379, 'Nůž univerzální FISKARS 1001622 je vhodný pro široké použití na zahradě. Nůž má plastový kryt a ergonomicky tvarovanou rukojeť s ochranou proti sklouznutí ruky. Čepel nože FISKARS je vyrobena z kvalitní \nnerezové oceli.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(392, 'Souprava pro údržbu zahradních nůžek FISKARS 1001640 obsahuje návod na údržbu a ostření, diamantový brousek a olej. Instrukce na ostření, mazání, čištění, skladování apod. jsou v letáku znázorněny formou \nobrázků a symbolů. Diamantový brousek s dlouhou životností je vhodný na kalené ocelové čepele. I malé naostření velmi zvyšuje výkon! Olej snižuje tření a chrání proti korozi.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1616, 'Nůžky na trávu FISKARS Servo-System 1000589 jsou určeny pro zastřihávání okrajů trávníku. Díky důmyslnému mechanismu zahradní nůžky trávu nikdy nežvýkají. Čepele jsou vyrobeny z kvalitní zakalené švédské chromové \noceli a mají dlouhou životnost. Úhel střihu lze nastavit v rozmezí 360°. Nůžky mají lehká a pevná držadla. Účinný mechanismus zvyšuje střižnou sílu.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1617, 'Nůžky univerzální FISKARS Fingerloop 1001533 jsou ergonomicky navrženy k pohodlnému a snadnému použití. Mají silné čepele z nerezové oceli pro stříhání tenkých plechů, plastů, hadic, drátů apod. Nejsou však určeny pro stříhání větví. Spodní držadlo ve tvaru oka chrání prsty během střihu. Držadla jsu vyrobena z materiálu FiberCompTM a bezpečně se drží. Nůžky jsou extrémně lehké a pevné.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1618, 'Nůžky dvoučepelové zahradní \nFISKARS 1001531 jsou vhodné pro stříhání čerstvých výhonů a větví o průměru do 20 mm. Nůžky FISKARS mají odolné čepele z nerez oceli, které zůstávají ostré i po dlouhodobém užívání. Držadla zahradních nůžek jsou vyrobena z materiálu FiberCompTM a mají patentovaný mechanismus PowerLeverTM, který snižuje námahu a umožňuje zapojení všech prstů najednou.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1620, 'Hrábě na listí FISKARS QuikFit 1000642 jsou široké hrábě na účinné hrabání listí a posekané trávy. Hrábě mají 25 pružných prstů z vysoce kvalitního plastu PBT, které vydrží \nohýbání. Umožňují snadnou a pohodlnou práci. K hrábím je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1621, 'Škrabka na plevel FISKARS QuikFit 1000738 slouží k odstranění plevelů a narušení povrchu půdy pohybem tam a zpět. Pracovní část je vyrobena z bórové oceli. Ke škrabce je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1628, 'Nůžky univerzální FISKARS 1000555 jsou vhodné na \nzastřihávání květin a rostlin, ale i zahradních drátků. Extra tvrdé čepele jsou vyrobeny z karbonové oceli a držadla z nárazuvzdorného plastu \nPBT. Držadla jsou navrženy tak, aby vyhovovala přirozenému pohybu ruky. Zoubkované ostří napomáhá lepšímu střihu a pohodlné práci.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1629, 'Nůžky univerzální FISKARS 1001539 jsou vhodné na \nzastřihávání květin a rostlin, ale i zahradních drátků. Extra tvrdé čepele jsou vyrobeny z karbonové oceli a držadla z nárazuvzdorného plastu \nPBT. Držadla jsou navrženy tak, aby vyhovovala přirozenému pohybu ruky.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1630, 'Nůžky univerzální FISKARS 1001538 jsou vhodné na \nzastřihávání květin a rostlin, ale i zahradních drátků. Extra tvrdé čepele jsou vyrobeny z karbonové oceli a držadla z nárazuvzdorného plastu PBT. Držadla jsou navrženy tak, aby vyhovovala přirozenému pohybu ruky.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1634, 'Nůžky zahradní \njednočepelové FISKARS SingleStep 1000564 jsou vhodné pro stříhání výhonů a suchého dřeva. Čepele jsou vyrobeny z kvalitní karbonové oceli, jejíž vrchní část je potažena kluznou vrstvou PTFE, která usnadňuje stříhání i čištění. Pevný doraz nůžek FISKARS je vyroben z polyamidu. Celkový dobře vyvážený design usnadňuje úchop a ve výsledku samotnou práci.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1635, 'Nůžky univerzální FISKARS SingleStep 1000570 mají silné čepele z nerezové oceli vhodné pro stříhání tenkých plechů, plastů, hadic, drátů apod. Nejsou však určeny pro stříhání větví. Nůžky mají masivní \nkompozitní tělo a spolehlivý mechanismus, který zaručuje bezchybné fungování. Držadla jsou vyrobena z lehkého a pevného polypropylénu. Jejich provedení je skvěle vyvážené pro co nejpohodlnější práci.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1636, 'Nůžky univerzální dílenské FISKARS SingleStep 1000571 jsou určené pro stříhání tenkých plechů, plastů, hadic, drátů apod. Nejsou určeny pro stříhání větví. Čepele jsou vyrobeny z kvalitní karbonové oceli, držadla z lehkého a pevného polypropylénu. Dobře vyvážený design nůžek FISKARS usnadňuje úchop a ve výsledku i samotnou práci.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1639, 'Zahradní nůžky převodové jednočepelové FISKARS 1000572 mají ergonomicky tvarovaná držadla vyrobená \nz extra pevného polyamidu vyztuženého skelnými vlákny. Čepele nůžek jsou ze zakalené nerezové oceli a v nepracovní poloze jsou jištěny bezpečnostním zámkem.', NULL, NULL, '2021-07-19 09:54:55', '2021-07-19 09:54:55'),
	(1643, 'Nůžky zahradní dvoučepelové \nFISKARS 1001424 jsou víceúčelové nůžky \ns nastavitelným rozevřením čepelí. Zahradní \nnůžky umožňují snadný střih tenkých i silnějších větví do průměru 24 mm. Nůžky FISKARS mají pohodlný zámek ovladatelný jednou rukou, který zajistí bezpečnost při uložení nůžek, a neklouzavá držadla z materiálu SoftGripTM.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1645, 'Nůžky dvoučepelové dvouruční FISKARS M 1001537 jsou vhodné pro stříhání výhonů a větví o průměru do 22 mm. Zahradní nůžky vám umožní \ndosáhnout dále, aniž byste se natahovali a napomůžou snížit únava svalů na rukách i po delší pracovní době. Čepel nůžek FISKARS je potažená vrstvou PTFE pro účinnější střih i čištění.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1647, 'Nůžky zahradní dvoučepelové FISKARS Quantum 1001434 jsou vhodné pro stříhání výhonů a větví o průměru do 26 mm. Zahradní nůžky jsou kombinací krásného designu a funkcionality. Čepele z kalené oceli jsou precizně vybroušené a potažené povrchem snižující tření a zajišťující čistý a přesný řez. Nůžky mají mechanismus pro nastavení přítlaku čepelí, který zabraňuje uvolnění během střihu.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1650, 'Nůžky na silné větve dvoučepelové FISKARS SingleStep 1001432 mají čepel vyrobenou z kvalitní kalené oceli potažené vrstvou snižující tření a držadla z lehkého a pevného polypropylénu. Zahradní nůžky jsou určeny pro stříhání čerstvých větví, zmenšování živého plotu nebo vystřihávání křovin. Masivní a vyvážený design nůžek usnadňuje úchop a ve výsledku i samotnou práci.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1651, 'Jednočepelové nůžky převodové na silné větve FISKARS 1000581 jsou \nvhodné pro všechny druhy střihání v zahradě \naž do průměru větví 35 mm. Zahradní nůžky maji unikátní převod PowerGear™ zvyšující střižný výkon. Čepel je vyrobena \nz kalené nerez oceli s dlouhou trvanlivostí, rukojeť z kompozitního materiálu FiberComp™ zaručujícím vysokou pevnost.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1652, 'Nůžky na silné větve FISKARS Quantum 1001436 mají \nnůžkovou hlavu pro přesné a čisté stříhání větví o průměru do 28 mm. Tyto \nzahradní nůžky jsou kombinací pěkného designu a funkcionality. Mají pevné hliníkové tělo, precizně vybroušené čepele z kalené oceli potažené vrstvou snižující tření a zajišťující přesný řez, a unikátní korkem vykládaná držadla. Nůžky FISKARS Quantum jsou velmi lehké a pevné zároveň.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1660, 'Nůžky na silné větve dvoučepelové FISKARS Quantum 1001438 jsou určené pro intenzivní stříhání čerstvého dřeva o průměru do 38 mm. Tyto zahradní nůžky jsou kombinací pěkného designu a funkcionality. Mají pevné hliníkové tělo, precizně vybroušené čepele z kalené oceli potažené vrstvou snižující tření a zajišťující přesný řez, a unikátní \nkorkem vykládaná držadla. Nůžky FISKARS Quantum jsou velmi lehké a pevné zároveň.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1663, 'Nůžky jednočepelové na silné větve FISKARS M 1001550 mají vrchní pohyblivou čepel z vysoce kvalitní kalené karbonové oceli a pevný doraz z litého hliníku umožňující snadnější stříhání \ntvrdého, suchého dřeva o průměru až do 50 mm. Zahradní nůžky mají patentovaný mechanismus PowerGearTM, který zvyšuje střižnou sílu. Rukojeť je zohotvena z kompozitního materiálu FiberCompTM s vysokou pevností.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1664, 'Nůžky na silné větve jednočepelové FISKARS SingleStep \n1001430 jsou určeny pro stříhání suchého a tvrdého dřeva o průměru do 40 mm. Vrchní čepel je vyrobena z kalené oceli potažené vrstvou snižující tření, masivní držadla z lehkého a pevného polypropylénu. Zahradní nůžky FISKARS mají pevný doraz z lehkého tvrzeného hliníku.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1665, 'Nůžky na silné větve dvoučepelové FISKARS SingleStep 1001426 jsou určeny  pro stříhání silných čerstvých větví, pro zmenšování \nživého plotu nebo vystřihávání křovin. Čepele nůžek jsou vyrobeny z kalené oceli potažené vrstvou snižující tření, masivní \ndržadla z lehkého a pevného polypropylénu. Nůžky FISKARS jsou skvěle vyváženy pro co nejpohodlnější práci.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1671, 'Nůžky na silné větve jednočepelové FISKARS Quantum 1001437 jsou určené pro stříhání suchého a tvrdého dřeva. Tyto zahradní nůžky jsou příkladem přírodní krásy a designu. Mají pevné hliníkové tělo, precizně vybroušené \nčepele z kalené oceli potažené vrstvou snižující tření a zajišťující přesný řez, a unikátní korkem vykládaná držadla. Nůžky FISKARS Quantum jsou velmi lehké a pevné zároveň.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1673, 'Nůžky na silné větve dvoučepelové FISKARS Quantum 1001435 jsou určené pro intenzivní stříhání čerstvého dřeva. Tyto zahradní nůžky jsou příkladem kombinace pěkného designu a funkcionality. Mají pevné hliníkové tělo, precizně \nvybroušené čepele z kalené oceli potažené vrstvou snižující tření a zajišťující přesný řez, a unikátní korkem vykládaná držadla. Nůžky FISKARS Quantum jsou velmi lehké a pevné zároveň.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1674, 'Nůžky na trávu a živý plot pákové FISKARS 1001565 jsou \nurčeny ke stříhání trávy, živých plotů, křovin a podobných materiálů až do průměru 10 mm. Díky důmyslnému mechanismu zahradní nůžky trávu nikdy nežvýkají. Umožňují práci ve vpřímené poloze. Čepele jsou vyrobeny z kvalitní zakalené švédské chromové oceli a mají dlouhou životnost. Sklon natočení \nstříhací hlavy lze nastavit v rozmezí 270°. Nůžky mají lehká a pevná držadla. Účinný mechanismus zvyšuje střižnou sílu.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1676, 'Nůžky na živý plot s vlnitým ostřím FISKARS SingleStep 1001433 jsou určeny pro zastřihávání živých plotů a křovin. Zahradní nůžky mají komfortní a odolné rukojeti z polypropylenu vyztuženého sklenými vlákny a čepele s vlnitým \nostřím z kalené oceli potažené vrstvou snižující tření. Nůžky FISKARS jsou masivní \na zároveň dobře vyvážené pro co nejpohodlnější práci.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1677, 'Nůžky na živý plot s pákovým převodem FISKARS 1001564 jsou vhodné pro zastřihávání živých plotů a křovin s nižším vynaložením síly. Držadla zahradních nůžek jsou vyrobena z \nFiberCompTM a jsou extrémně lehká a pevná. Mechanismus PowerLeverTM umožňuje stříhat s vynaložením 2,5x menší síly než u běžných mechanismů. Robustní pákový převod zaručuje dlouhou životnost nůžek FISKARS a bezproblémové používání.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1678, 'Nůžky na živý plot se zubovým převodem FISKARS 1000596 jsou ideální pro stříhání živých plotů a keřů. Zahradní nůžky mají speciální zubový převodový mechanismus, který postupně zvyšuje střižnou sílu při dostřižení až 3 krát. Čepel je vyrobena z kalené nerez oceli s dlouhou trvanlivostí, rukojeť z kompozitního materiálu FiberCompTM zaručujícím vysokou pevnost.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1679, 'Nůžky na živý plot FISKARS Quantum 1001449 jsou určené pro zastřihávání živých plotů a křovin. Tyto zahradní nůžky jsou kombinací pěkného designu a funkcionality. Mají pevné hliníkové tělo, precizně vybroušené \nčepele z kalené oceli potažené vrstvou snižující tření a zajišťující přesný řez, a unikátní korkem vykládaná držadla. Nůžky FISKARS Quantum jsou velmi lehké a pevné \nzároveň.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1683, 'Klín štípací spirálovitý SAFE-T FISKARS 1001615 z kované oceli má \nnástavec z vysoce odolného polyamidu s kovovým prstencem. Štípací klín snižuje nebezpečí zranění odlétajícími střepinami oceli a díky své konstrukci redukuje nebezpečí zranění z opakovaných rázů. Skvěle tlumí údery.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1685, 'Výměnná hlava ke štípacímu klínu FISKARS 1001616 slouží jako nástavec pro štípací spirálovitý \nklín SAFE-T FISKARS 120021. Nástavec je vyroben z odolného \npolyamidu s kovovým prstencem. Skvěle tlumí rázy a snižuje nebezpečí úrazu způsobeného odlétajícími střepinami z oceli.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1686, 'Pilka zahradní s pevnou čepelí FISKARS 1001620 je určená pro snadné řezání dřeva \naž do průměru 220 mm. Tvar zubů je velmi účinný pro rychlé a přesné řezání syrového řeva. Měkké držadlo pilky FISKARS je ergonomicky zahnuté. Pilku dodáváme v plastovém pouzdře.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1687, 'Pilka stavební FISKARS Xtract 1000612 má menší zuby vhodné k řezání suchého dřeva a prken až do průměru 120 mm. Pilka má unikátní vysouvací mechanismus s integrovanou karabinou na opasek a pohodlné a bezpečné držadlo SoftGrip TM , které ochrání vaše prsty před jejich sklouznutím na čepel.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1688, 'Nůž K20 FISKARS 1001626 je určený především pro řezání minerální vlny. Nůž má čepel z vysoce kvalitní nerezové oceli a \nergonomické držadlo s chráničem prstů.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1689, 'Očkovací nůž FISKARS 1001625 slouží k očkování, řezání a úpravě dřevin a rostlin. Čepel nože je vyrobena z vysoce kvalitní nerezové oceli, držadlo z pevného recyklovaného plastu s mosaznými \nnýty.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1694, 'Rýč lehký zahradní rovný FISKARS 131500 je vhodný pro rytí, hloubení děr pro sázení, zarovnávání záhonů a přehazování malých objemů zeminy. Kalená bórová ocel \nzaručuje pevnost a usnadňuje pronikání do půdy. Rýč má velké držadlo ve tvaru D, které lze uchopit velkou i malou rukou, a to i v rukavicích. Odolná násada rýče FISKARS je vyrobena z tvrzeného hliníku a potažená plastem pro pohodlný a pevný úchop.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1697, 'Lopata FISKARS Ergonomic 1001579 je určená pro nakládání písku, půdy a jiných sypkých materiálů. Pracovní část z kvalitní kalené bórové oceli zajišťuje maximální pevnost. Optimální úhel mezi násadou a čepelí minimalizuje únavu zad, rukou a zápěstí. Plastový potah násady lopaty FISKARS poskytuje prozměnu pohodlný úchop.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1705, 'Vidle lehké rycí FISKARS 133500 jsou určeny pro kypření a obracení zahradní zeminy, k provzdušňování a vybírání kamenů a plevele. Kalená bórová ocel zaručuje pevnost a usnadňuje práci. Vidle mají velké držadlo ve tvaru D, které lze uchopit velkou i malou rukou, a to i v rukavicích. Odolná násada vidlí FISKARS je vyrobena z tvrzeného hliníku a potažená plastem pro pohodlný a pevný úchop.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1706, 'Ruční zemní vrták QuikDrill FISKARS 1000636 velikost S má dvě optimálně nakloněné čepele z kvalitní bórové oceli upevněné kolem ostrého hrotu. Tento design vrtáku vám umožní proniknout i do tužších půd s menším odporem, přičemž brání mačkání země. Vyhazování vyvrtaného materiálu na úhlednou hromadu je snadné a požadovaný otvor je brzy vyvrtán.', NULL, NULL, '2021-07-19 09:54:56', '2021-07-19 09:54:56'),
	(1708, 'Ruční zemní vrták QuikDrill FISKARS 1000638 velikost M má \ndvě optimálně nakloněné čepele z kvalitní bórové oceli upevněné kolem ostrého hrotu. Tento design vrtáku vám umožní proniknout i do tužších půd s menším odporem, přičemž brání mačkání země. Vyhazování vyvrtaného materiálu na úhlednou hromadu je snadné \na požadovaný otvor je brzy vyvrtán.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1710, 'Ruční zemní vrták QuikDrill FISKARS 1000640 velikost L má \ndvě optimálně nakloněné čepele z kvalitní bórové oceli upevněné kolem ostrého hrotu. Tento design vrtáku vám umožní proniknout i do tužších půd s menším odporem, přičemž brání mačkání země. Vyhazování vyvrtaného materiálu na úhlednou hromadu je snadné a požadovaný otvor je brzy vyvrtán.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1714, 'Ruční kultivátor FISKARS Solid 1001600 je určený pro kypření a hnojení na zahradě. Kultivátor je vyroben z pevného polyamidu vyztuženého skelnými vlákny a má ergonomicky tvarované držadlo s otvorem na konci pro zavěšení nářadí v době nečinnosti. Kultivátor skvěle odolává i extrémním teplotám v rozmezí -40°až +150°a je 100% recyklovatelný. Nářadí je velmi trvanlivé a snadno se \nčistí. Zaoblené hrany nepoškozují půdu a kořínky.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1715, 'Vidle FISKARS 1000696 jsou určené pro \npráci s plevelem a kompostem. Vidle jsou vyrobeny z pevného polyamidu vyztuženého skelnými vlákny a jsou velmi trvanlivé a odolné. Zaoblené hrany nepoškozují půdu a kořínky. Vidle FISKARS skvěle odolávají \ni extrémním teplotám v rozmezí -40°až +150°a jsou 100% recyklovatelné. Vidle mají v násadě otvor pro zavěšení nářadí v době nečinnosti.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1716, 'Lopatka přesazovací FISKARS Premium 1000726 je vyrobena z lehkého a pevného materiálu FiberComp™ s pracovní \nčástí z nerezové oceli. Lopatka je tak skvěle funkční a navíc poskytuje při práci pohodlné uchopení díky měkkému plastu SoftGrip™ na držadle. Má ostré okraje pro snazší pronikání \ndo půdy a otvor v rukojeti pro zavěšení. Lopatka FISKARS snáší dobře i extrémní teploty, a to od \n-40°C do +150°C, a je 100% recyklovatelná.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1717, 'Lopatka přesazovací FISKARS Premium 1000727 je z lehkého a pevného materiálu FiberComp™ s pracovní částí z nerezové oceli. Je tak zajištěna perfektní funkčnost, umocněná navíc pohodlným uchopením měkkého držadla z plastového materiálu SoftGrip™. Lopatka FISKARS má v rukojeti otvor pro zavěšení. Dobře snáší i extrémní teploty, a \nto od -40°C do +150°C, a je 100% recyklovatelná.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1718, 'Kultivátor FISKARS Premium 1000728 je vyroben z lehkého a pevného materiálu FiberComp™ s pracovní částí z nerezové oceli. Je určený k provzdušnění a nakypření \npůdy. Kultivátor má otvor pro zavěšení a pohodlné držadlo z měkkého plastu SoftGrip™, které zpříjemňuje pracovní činnost. Kultivátor FISKARS snáší dobře i extrémní teploty, a to od -40°C do +150°C, a je 100% recyklovatelný.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1719, 'Vidle malé FISKARS Premium 1000729 jsou vhodné na sázení a pletí. Pracovní \nčást je vyrobena z kvalitní nerezové oceli. Pohodlná rukojeť z materiálu SoftGripTM s použitím materiálu FiberCompTM zaručuje pevnost a pohodlný úchop zároveň. Na koncí vidlí je otvor pro zavěšení \nnářadí v době nečinnosti.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1722, 'Shrnovač na sníh profesionální FISKARS 1001635 je velmi lehký a přitom velice efektivní. Pracovní část shrnovače je vyrobena z tvrzeného hliníku, násada z hliníku potažená ergonomickým plastovým potahem.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1742, 'Adaptér univerzální FISKARS QuikFit 1000617 slouží pro připojení nástavců od jiných výrobců na násadu FISKARS QuikFit. Adaptér je vyroben z lehkého pevného kompozitního materiálu FiberCompTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1743, 'Hrábě univerzální FISKARS QuikFit 1000643 jsou určeny k hrabání trávy, plevele, mechu, přípravě záhonu před setím a na zpracování půdy. Hrábě mají 12 zubů z pevného kompozitního materiálu FiberCompTM a hranu pro rovnání povrchů záhonů. K hrábím je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1744, 'Hrábě úzké FISKARS QuikFit 1000651 mají unikátní tvar, který umožňuje  hrabat mezi rostlinami a keři bez jejich poškození. Hrábě jsou ideální na malé záhony. Mají 10 zubů z kalené bórové oceli. K hrábím je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1745, 'Hrábě FISKARS QuikFit 1000654 jsou určeny k hrabání a vyrovnávání \nzáhonů. Hrábě mají 16 hrotů z kalené karbonové oceli. K hrábím je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1746, 'Hrabě provzdušňovací FISKARS QuikFit 1000655 slouží k efektivnímu odstranění mechu \na uschlé trávy z trávníků. Hrábě jsou vyrobeny z kvalitní kalené oceli. K hrábím je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1747, 'Hrábě široké FISKARS QuikFit 1000656 jsou vhodné k hrabání větších ploch. Hrábě jsou vyrobeny z kvalitní kalené oceli. K hrábím je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1748, 'Kartáč na spáry FISKARS QuikFit 1000657 slouží k odstraňování mechu a plevele mezi dlaždicemi. Kartáč má ocelové štětiny a lehkou odolnou konstrukci z materiálu FiberCompTM. Ke kartáči je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1749, 'Koště univerzální FISKARS QuikFit 1001417 je víceúčelové koště se speciální \npracovní částí PowerCleanTM, která v sobě kombinuje měkké a tuhé štětiny pro účinné zametání. Ke koštěti je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1750, 'Koště na terasy FISKARS QuikFit 1001416 je vhodné k zametání \nhladkých povrchů, jako jsou terasy, palubky a leštěné betonové podlahy. Široká pracovní část a měkké štětiny umožňují rychlé a \núčinné zametání. Ke koštění je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1751, 'Smeták FISKARS QuikFit 1001415 má robustní konstrukci a dlouhé štětiny, které jsou vhodné pro zametání hrubších nečistot. \nKe smetáku je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1752, 'Čistič okapů FISKARS QuikFit 1001414 slouží pro efektivní a pohodlné čištění okapů ze země. Čistič je kombinací kartáče a škrabky, které umožňují perfektní vyčištění okapů. Stavitelný úhel dovoluje práci v optimální poloze. K čističi okapů je zapotřebí \ndokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1753, 'Úzké hrábě na listí FISKARS \nQuikFit 1000659 jsou praktické hrábě k hrabání mezi úzkými záhony. Hrábě mají 11 pružných prstů z vysoce kvalitního plastu PBT, které vydrží ohýbání. Při práci vyžadují menší sílu. K hrábím je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1754, 'Hrábě úzké FISKARS QuikFit 1001412 mají 7 ocelových \nprstů a jsou ideální pro hrabání mezi rostlinami. K hrábím je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1755, 'Krátká násada FISKARS QuikFit S 1000663 je vyrobena z tvrzeného hliníku a potažená příjemným měkkým plastem pro pohodlné uchopení. Násada je určena pro připojení zahradního nářadí FISKARS \nQuikFitTM. Násada má patentovaný mechanismus pro rychlé \npřipojení různých nástavců a závěsné očko pro skladování.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1756, 'Násada FISKARS QuikFit M 1000664 je vyrobena z tvrzeného hliníku s měkkým \nplastovým zakončením. Násada je určena pro připojení zahradního nářadí FISKARS QuikFitTM. Násada má unikátní zámek, který umožňuje výměnu nástavce během několika vteřin, a závěsné očko pro skladování.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1757, 'Násada teleskopická FISKARS QuikFit 1000665 ve spojení se zahradním nářadím FISKARS QuikFitTM je speciálně \nnavržená pro dosažení do výšek až 6 m. \nNásada má dvojitý zámek pro bezpečné použití. Je vyrobena z hliníku a má nízkou hmotnost.', NULL, NULL, '2021-07-19 09:54:57', '2021-07-19 09:54:57'),
	(1758, 'Motyčka \nholandská FISKARS QuikFit 1000676 má dokonale ostrou hranu \npro efektivní odstranění plevelů a mechů nebo tvarování řádků před setím. Pracovní \nčást je vyrobena z bórové oceli. K motyčce je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1759, 'Motyčka FISKARS QuikFit 1000677 je účinným nástrojem k odstranění plevelu mezi řádky. Pracovní část je vyrobena z nerezové oceli. K motyčce je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1760, 'Kultivátor FISKARS QuikFit 1000680 je určený ke kultivaci a provzdušnění půdy, pro přípravu záhonů. Hroty jsou vyrobeny z kalené karbonové oceli. Ke kultivátoru je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1761, 'Kultivátor s motyčkou FISKARS QuikFit 1000681 je efektivním dvojitým nástrojem ke kultivaci a provzdušnění \npůdy a pro přípravu záhonů. Hroty a motyčka \njsou vyrobeny z kalené karbonové oceli. Ke kultivátoru je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1762, 'Kultivátor zahnutý FISKARS QuikFit 1000683 je vhodný k šetrnému kypření půdy kolem rostlin pro snazší hnojení. Pracovní část je vyrobena z kvalitní karbonové oceli. Ke kultivátoru je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1763, 'Ruční kultivátor FISKARS QuikFit 1000685 je určený ke kultivaci a provzdušnění záhonů. Pracovní část je vyrobena \nz kalené karbonové oceli. Ke kultivátoru je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1764, 'Nůž \nna spáry FISKARS QuikFit 1000687 je ideální nástroj na čištění spár mezi dlaždicemi od mechu a plevele. Čepel nože je vyrobena z kalené bórové oceli. K noži je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1765, 'Provzdušňovač trávníku FISKARS QuikFit 1000689 je určený k provzdušňování menších trávníků s horším přístupem s velkou zahradní technikou. Provzdušňovač umožňuje lepší přívod živin, \nvody a vzduchu ke kořenům trávy. Pracovní část je vyrobena z kvalitní kalené oceli. K provzdušňovači je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1766, 'Nůžky univerzální FISKARS QuikFit 1001410 mají zvýšenou střižnou sílu díky mechanismu PowerReelTM. Páka a kladka zvyšují střižnou sílu až 12x v porovnání se standardním mechanismem. Úhel stříhací hlavy lze nastavit do druhé polohy 26°, aniž byste museli nůžky sundat. Možnost držení nástroje oběma rukama zvyšuje stabilitu. Nůžky nemají žádná vnější \nlanka na stříhací hlavě.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1767, 'Nůž na okraje trávníků \nFISKARS QuikFit 1000690 je určen k odkrojení přerostlého okraje trávníku. Čepel nože je vyrobena z bórové oceli s plochým horním okrajem. Nůž se do tvrdé půdy zarazí stoupnutím na horní část. K noži je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1768, 'Pila zahnutá FISKARS QuikFit 1000691 je určena k řezání větví ve výškách po nasazení teleskopické násady FISKARS QuikFit. Doraz na začátku a na konci pily usnadňuje práci a pila z řezu nevyjíždí. Pilový list je kalený. Objímka a zámek je z materiálu FiberCompTM. \nK nůžkám je zapotřebí dokoupit násadu FISKARS QuikFit.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1769, 'Pila prořezávací přímá FISKARS QuikFit 1000692 je vhodná pro řezání větví ve výškách i běžné řezání materiálů na dosah ruky. Čepel je vyrobena z kalené oceli, objímka a zámek z materiálu FiberCompTM. K pile je zapotřebí dokoupit násadu FISKARS \nQuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1771, 'Lopatka FISKARS QuikFit 1000730 je vhodná k sázení a přesazování. Čepel je vyrobena z \nbórové oceli. K lopatce je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1772, 'Vypichovák plevele FISKARS QuikFit 1000731 slouží k odstraňování plevelů, např. pampelišek a bodláků. Je vhodný pro úzká místa. Čepel je vyrobena z bórové oceli. K vypichováku plevele je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1773, 'Vidle malé FISKARS QuikFit 1000733 jsou určeny k přesazování, kultivaci a odstraňování plevelů. Čepel je vyrobena z bórové oceli. K vidlím je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1774, 'Škrabka na čištění spár dvoustranná FISKARS QuikFit 1000734 slouží ke snadnému čištění dlaždic od mechu a plevelů nebo ke kultivaci záhonů. Čepel je vyrobena z kvalitní bórové oceli. \nKe škrabce je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1775, 'Škrabka na led FISKARS 1001639 má lakovanou čepel z kalené bórové oceli a dřevěnou násadu. Škrabka je vhodná k efektivnímu odstraňování ledu.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1777, 'Lopata na sníh a obilí FISKARS 1001637 má pracovní část z tvrzeného hliníku a násadu z březového dřeva s polypropylenovým držadlem. Lopata je určena k úklidu sněhu, ale také pro práci s obilím.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1778, 'Lopata na sníh a obilí FISKARS 1001638 má pracovní část z tvrzeného hliníku a násadu z březového dřeva s polypropylenovým držadlem. Lopata je určena k úklidu sněhu, ale také pro práci s obilím.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(1780, 'Hrablo na sníh FISKARS QuikFit 1000743 je ideální pro shrnování sněhu z teras a menších dvorků. Pracovní část hrabla je z PP plastu s hliníkovou lištou. K hrablu je zapotřebí dokoupit násadu FISKARS QuikFitTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(3679, 'Nůžky na trávu FISKARS 1000557 jsou vhodné pro stříhání \ntrávy, tvarování buxusů, tisů a jiných podobných rostlin. Nastavitelný přítlak čepelí centrálním šroubem zaručuje stále přesné \nstříhání. Držadla jsou potažena materiálem SoftGripTM pro zvýšené pohodlí při práci.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(3682, 'Zahradní dvoučepelové nůžky FISKARS Inspiration Ruby 1003657 jsou ideální pro stříhání mladého a čerstvého dřeva. Nůžky mají čepele z kvalitní karbonové oceli, masivní držadla pro pohodlné \nuchopení a dobře vyvážený design pro solidní \npráci. Nepřilnavý povrch PTFE vrchní čepele snižuje tření a usnadňuje stříhání a čištění.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(3683, 'Zahradní dvoučepelové nůžky FISKARS Inspiration Lucy 1003664 jsou ideální pro stříhání mladého a čerstvého dřeva. Nůžky mají čepele z \nkvalitní karbonové oceli, masivní držadla pro pohodlné uchopení a dobře vyvážený design pro \nsolidní práci. Nepřilnavý povrch PTFE vrchní čepele snižuje tření a usnadňuje stříhání a čištění.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(3684, 'Nůžky jednočepelové zahradní FISKARS 1001532 jsou vhodné na stříhání výhonů a větví, především na suché a tvrdé dřevo o průměru do 20 mm. Zahradní \nnůžky mají unikátní pákový převod \nnásobící střižnou sílu. Čepele jsou vyrobeny z kvalitní nerez oceli a zůstávají ostré i po dlouhodobém používání. Pevný doraz je vyroben z materiálu FiberCompTM.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(3685, 'Nůžky zahradní \njednočepelové FISKARS Fingerloop 1001535 jsou vhodné pro zastřihávání výhonků a suchého dřeva. Čepele jsou vyrobeny z kvalitní nerezové oceli, horní držadlo potažené protiskluzovým povrchem SoftGripTM. Zahradní nůžky FISKARS mají pevný doraz \nz FiberCompTM pro zvýšení celkové pevnosti.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(3689, 'Nůžky teleskopické na silné větve FISKARS 1013564 jsou vhodné pro stříhání silných větví ve výškách nebo u země. Při práci oceníte možnost nastavení délky držadel, a to v rozmezí 665 až 915 mm. Zahradní nůžky FISKARS jsou velmi lehké a nevysilují \nvaše ruce. Jsou optimálně tvarované a skvěle padnou do ruky. Mají současně elegantní i ergonomický \ndesign.', NULL, NULL, '2021-07-19 09:54:58', '2021-07-19 09:54:58'),
	(3691, 'Nůžky teleskopické na živý plot FISKARS 1013565 jsou vhodné pro zastřihávání živých plotů a křovin ve výškách nebo u země. Při práci oceníte možnost nastavení délky držadel, a to v rozmezí 675 až 925 mm. Zahradní nůžky FISKARS jsou velmi lehké a \npři stříhání nevysilují vaše ruce. Jsou optimálně tvarované a skvěle padnou do ruky. Mají současně elegantní i ergonomický design.', NULL, NULL, '2021-07-19 09:54:59', '2021-07-19 09:54:59'),
	(3692, 'Nůžky zahradní univerzální jednočepelové FISKARS 115350 jsou víceúčelovým nástrojem \ns vynikajícím dosahem do korun stromů a hustých keřů. Můžete s nimi bezpečně stříhat ve výškách bez potřeby žebříku nebo naopak u země, aniž byste se museli sklánět. Unikátní mechanismus umožňuje stříhat s vynaložením 12x menší síly než u nůžek s tradičním mechanismem. Střihací hlava je nastavitelná v rozsahu 26°. Práce s nůžkami FISKARS je vždy rychlá, snadná a bezpečná.', NULL, NULL, '2021-07-19 09:54:59', '2021-07-19 09:54:59'),
	(3694, 'Dřevorubecká kalač Fiskars 2500 1001704 má širokou čepel a je ideální na půlení špalků a osekávání přebytečnych větví. Materiál je z kované a kalené oceli, široká, zaoblená hlava pro snadnější trefení klínu. Násada je vytvořená tak, aby zabránila vibracím a skluzu.  ', NULL, NULL, '2021-07-19 09:54:59', '2021-07-19 09:54:59'),
	(3695, 'Dřevorubecký kalač Fiskars 3700 1001705 má širokou čepel, která je ideální na půlení špalků a osekávání přebytečnych větví. Materiál z kterého je vyroben je kovaná a kalená ocel. Široká, zaoblená hlava pro snadnější trefení klínu. Násada je vytvořená tak, aby zabránila vibracím a skluzu. ', NULL, NULL, '2021-07-19 09:54:59', '2021-07-19 09:54:59'),
	(3696, 'Mačeta FISKARS WoodXpert XA3 1003609 je vhodná pro odstranění menších větví, stromků a keřů, ale také pro loupání kůry z kulatiny. S podporou mačety FISKARS si výrazně zjednodušíte práci s přípravou dříví.', NULL, NULL, '2021-07-19 09:54:59', '2021-07-19 09:54:59'),
	(3697, 'Mačeta FISKARS WoodXpert XA23 1003621 je vhodná pro odstranění větších větví, stromků a keřů a pro sekání \ndrobnějšího palivového dříví. Mačeta FISKARS je vyrobená z kvalitních materiálů, je ergonomicky tvarovaná a při práci velmi pohodlná, usnadní vám zpracování a přípravu dříví.', NULL, NULL, '2021-07-19 09:54:59', '2021-07-19 09:54:59'),
	(3698, 'Sapina FISKARS WoodXpert XA2 1003622 je určena pro přenášení, zvedání a manipulaci s kulatinou. Díky sapině FISKARS snadno a jednoduše otočíte a přerovnáte kulatinu a další dřevo určené ke zpracování. Sapina je perfektně vyvážená a její topůrko skvěle padne do \nruky. Ostrý hrot se do dřeva snadno zapíchne.', NULL, NULL, '2021-07-19 09:54:59', '2021-07-19 09:54:59'),
	(3699, 'Sapina FISKARS WoodXpert XA22 1003623 je určena pro přenášení, zvedání a manipulaci se středně těžkou, delší kulatinou. Díky sapině FISKARS bez námahy a jednoduše otočíte a přerovnáte kulatinu a další dřevo určené ke zpracování. Sapina je perfektně vyvážená a její topůrko dobře padne do ruky. \nOstrý hrot se skvěle zapíchne do dřeva.', NULL, NULL, '2021-07-19 09:54:59', '2021-07-19 09:54:59'),
	(3700, 'Víceúčelový opasek FISKARS WoodXpert 1003626 je ergonomicky tvarovaný opasek, který se perfektně přizpůsobí spodní části zad. Opasek FISKARS oceníte především při práci v lese nebo na zahradě, ve chvíli kdy používáte více druhů nářadí. Nářadí na opasek jednoduše zavěsíte a máte ho neustále po ruce.', NULL, NULL, '2021-07-19 09:54:59', '2021-07-19 09:54:59'),
	(3701, 'Hák na klády FISKARS WoodXpert 1003624 je určený pro zvedání \na přenášení polen. Hák využijete také při asistování při kácení stromů. Hák na klády FISKARS dodáváme včetně plastového pouzdra pro snadné přenášení na pracovním opasku.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3702, 'Kleště na klády FISKARS WoodXpert 1003625 jsou vyrobeny z kvalitní nerezové oceli a jsou určeny pro zvedání a přenášení polen až do průměru 20 cm. Kleště na klády vám usnadní manipulaci \nse dřevem při zpracování většího množství dříví. Kleště na klády FISKARS dodáváme s praktickým plastovým pouzdrem pro snadné přenášení na pracovním opasku.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3703, 'Rovný rýč FISKARS Solid 1003456 má naostřenou čepel, která \nje svařená s násadou, což výrazně prodlužuje životnost celého rýče. Rýč FISKARS má ergonomicky tvarovanou násadu pro pohodlnou práci na zahrádce a plastové držadlo chránící ruku před chladem. ', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3704, 'Špičatý rýč FISKARS Solid 1003455 má svařovanou násadu s čepelí, což prodlužuje životnost rýče. Rýč FISKARS má naostřenou čepel, ergonomicky tvarovanou násadu a plastové držadlo, \nkteré chrání ruku před chladem. ', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3706, 'Lopata FISKARS Solid 1003457 je vhodná především k nakládání sypkých materiálů, např. písku, štěrku, betonu apod. Lopata FISKARS je \nvyrobena z kvalitní bórové oceli.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3707, 'Rycí vidle FISKARS Solid 1003458 mají pevné hroty, se kterými můžete pracovat i v kamenité půdě. Držadlo je ve tvaru písmene D a lze ho pohodlně uchopit i v rukavicích. Násada je velmi odolná a má krůhový průřez. Vidle FISKARS jsou určené na práci se zahradním odpadem, ale také na provzdušňování trávníku.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3708, 'Vidle kompostové \nFISKARS Ergonomic 1001695 jsou vhodné k nakládání \na obracení kompostu, větviček, natě apod. Pracovní \nčást je vyrobena z kvalitní bórové oceli, která zajišťuje maximální pevnost. Plastový potah násady vidlí poskytuje pohodlné držení při práci a optimální úhel mezi násadou a čepelí zas prozměnu minimalizuje únavu zad, rukou a zápěstí.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3709, 'Vidle kompostové FISKARS Solid 1003459 mají dlouhé a pevné hroty, které \nse skvěle hodí k nakládání kompostu, větviček a natě. Hroty jsou vyrobeny z trvanlivé bórové oceli. Násada má kruhový průřez a plastové madlo.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3710, 'Násada s úchytem FISKARS Solid 1014913 je lehká a pevná násada vyrobená z hliníku. Je určená pro čepel hrábí FISKARS Solid 1014914, 1014915 a 1014917. Lze ji také použít jako náhradní násadu pro hrábě FISKARS Solid 1003465, 1003464 a 1003466.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3711, 'Hrábě na listí čepel FISKARS Solid L 1014915 se širokou čepelí jsou vhodné pro hrabání velké plochy trávníku. Hrabě mají masivní pružné prsty se speciální geometrií, které zabraňují větvičkám a listí zachytávat se na čepeli. Jsou určeny pro násadu FISKARS Solid 1014913.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3712, 'Hrábě na listí FISKARS Solid L 1003465 jsou široké hrábě s pevnou hliníkovou násadou, vhodné pro práci na velkých plochách. Hrábě mají robustní pružné prsty, speciálně navržené tak, aby se mezi nimi nezachycovala tráva. Hrábě FISKARS jsou lehké a práce s nimi nevysílí.  ', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3713, 'Hrábě na listí FISKARS Solid M 1014914 jsou určeny pro menší plochy, kolem stromů, keřů apod. Hrábě mají masivní prsty, které dobře pracují na kořenovitém a nerovném povrchu. Jsou určeny pro násadu FISKARS Solid 1014913 nebo jako náhradní díl pro \nhrábě FISKARS 1003464.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3714, 'Hrábě na listí s násadou FISKARS \nSolid M 1003464 jsou velmi lehké a trvanlivé konstrukce. Násada je vyrobena z hliníku a má závěsné očko pro zavěšení nářadí v době nečinnosti. Hrábě FISKARS mají robustní pružné prsty, speciálně navržené tak, aby se \nmezi nimi nezachycovala tráva. Jsou určeny pro práci na menších plochách a kolem stromů. Jedná se o vysoce \nkvalitní zahradní nářadí, které vám vydrží po dlouhý čas.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3715, 'Hrábě univerzální čepel FISKARS Solid 1014917 jsou určeny pro hrabání dlouhé, posekané trávy, větviček nebo pro přípravů záhonů před osázením. Hrábě \njsou určeny pro násadu FISKARS Solid 1014913 nebo jako náhradní díl pro hrábě FISKARS 1003466.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3716, 'Hrábě univerzální s \nnásadou FISKARS Solid 1003466 jsou všestranným zahradním nářadím pro hrabání země, trávy, větviček, ale také k přípravě a rovnání \npovrchů záhonů díky horní ploché hraně. Hrábě mají lehkou, ale pevnou konstrukci. Násada je vyrobena z hliníku. Na konci násady je závěsné \nočko pro zavěšení nářadí v době nečinnosti.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3718, 'Koště víceúčelové FISKARS Solid 1003467 má pracovní část zkombinovanou z tuhých a měkkých štětin pro zvýšení účinnosti. Koště je masivní a zároveň lehké konstrukce. Práce s ním nevysiluje. Násada je vyrobena z hliníku, na jejím konci je očko pro zavěšení nářadí v době nečinnosti. Koště FISKARS je vhodné na čištění dlažby, teras a dvorů.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3720, 'Hrábě na listí lehké FISKARS 1000660 jsou široké \nhrábě určené pro práci na velkých plochách. Hrábě mají robustní pružné prsty, speciálně navržené tak, aby se mezi nimi nezachycovala tráva. Hrábě FISKARS mají měkké držadlo pro \npohodlné držení a na konci násady otvor pro zavěšení nářadí v době nečinnosti. Oválná hliníková násada je velmi lehká. Plastový \nnávlek na násadě zlepšuje držení a chrání před chladem.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3723, 'Motyčka lehká FISKARS 1000675 je určená k odstranění plevele a rozbítí hlinitých hrudek. Násada motyčky je vyrobena z tvrzeného hliníku a potažená plastem, čepel je \nz kalené karbonové oceli. Motyčka FISKARS má ergonomicky tvarovanou násadu, která zaručuje pohodlné držení při práci. Na konci násady je očko pro snadné zavěšení a uskladnění nářadí \nv zahradním domku.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3724, 'Lehký kultivátor FISKARS 1001301 je určený pro nakypření půdy na záhoncích. Hroty kultivátoru jsou vyrobeny z kvalitní kalené karbonové oceli, násada z tvrzeného hliníku potaženým plastem. Kultivátor FISKARS má \nergonomicky tvarovanou násadu, která zaručuje pohodlnou práci.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3726, 'Lopatka FISKARS Inspiration Ruby 1003665 je vyrobena z materiálu FiberCompTM, což činí nástroj extrémně lehkým, pevným a odolným vůči rzi. Čepel může být broušena. Lopatka má závěsný otvor pro snadné skladování. Lopatka FISKARS je ideální pro sázení \na přesazování.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3727, 'Lopatka FISKARS Inspiration Lucy 1003667 je vyrobena z materiálu FiberCompTM, což činí nástroj extrémně lehkým, pevným a odolným vůči rzi. Čepel může být broušena. Lopatka má závěsný otvor pro snadné skladování. Lopatka FISKARS je ideální pro sázení \na přesazování.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3728, 'Kultivátor FISKARS Inspiration Ruby 1003668 je vyroben z materiálu FiberCompTM, což činí nástroj extrémně lehkým, pevným a odolným vůči rzi. Hroty mohou být broušeny. Kultivátor má závěsný otvor pro snadné skladování. Kultivátor FISKARS je ideální pro provzdušnění a kypření půdy.', NULL, NULL, '2021-07-19 09:55:01', '2021-07-19 09:55:01'),
	(3729, 'Kultivátor FISKARS Inspiration Lucy 1003670 je vyroben z materiálu FiberCompTM, což činí nástroj extrémně lehkým, pevným a odolným vůči rzi. Hroty mohou být broušeny. Kultivátor má závěsný otvor pro snadné skladování. Kultivátor FISKARS je ideální pro provzdušnění a kypření půdy.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(3730, 'Motyčka FISKARS Inspiration Ruby 1003671 je vyrobena z materiálu FiberCompTM, což činí nástroj extrémně lehkým, pevným a odolným vůči rzi. Čepel a hroty mohou být broušeny. Motyčka má závěsný otvor pro snadné skladování. Motyčka FISKARS je ideální pro sázení a pletí.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(3731, 'Motyčka FISKARS Inspiration Lucy 1003696 je vyrobená z materiálu FiberCompTM, \nnástroj je extrémně lehký, pevný a odolný vůči rzi. Čepel a hroty mohou být broušeny. Motyčka má závěsný otvor pro snadné skladování. Motyčka FISKARS je ideální pro sázení a pletí.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(3740, 'Lopata na sníh FISKARS SnowXpert 1003468 je velmi lehká, určená pro snadnou práci s odklízením sněhu. Pracovní část je vyrobena z vakuově lisovaného polypropylénového plastu, který je plně recyklovatelný. Hliníková násada je extrémně pevná. Lopata na sníh má ergonomicky navržené držadlo a novou patentovou lištu s vloženým ocelovým drátem, která má trojnásobnou životnost oproti tradičním lištám, které pruží a opotřebovávají se.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(3742, 'Hrablo na sníh FISKARS SnowXpert 1003469 je určené pro efektivní odklízení sněhu. Pracovní část je vyrobena ze zesíleného polypropylénu, násada z hliníku s příjemným plastovým potahem. Hrablo má ergonomicky navržené držadlo a novou patentovou lištu s vloženým ocelovým drátem, která má trojnásobnou životnost.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(3743, 'Hrablo na sníh FISKARS Roller SnowXpert 1003471 je určené pro efektivní odklízení sněhu. Pracovní část je vyrobena ze zesíleného polypropylénu, násada z hliníku s příjemným plastovým potahem. Hrablo má ergonomicky navržené držadlo a novou patentovou lištu s vloženým ocelovým drátem, která \nmá trojnásobnou životnost. Je nejvhodnější pro odklízení vrstvy sněhu do 10 cm.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(3744, 'Shrnovač \nna sníh FISKARS SnowXpert 1003470 je lehký nástroj pro odklízení sněhu na větších plochách. \nShrnovač má dlouhé držadlo z ocelové trubky a pracovní část vyrobenou ve stříkacím lisu pro \nvětší stabilitu a nízkou hmotnost. Shrnovač FISKARS je vybaven novou patentovou lištou s vloženým ocelovým drátem, která má trojnásobnou životnost oproti tradičním lištám, které pruží a opotřebovávají se.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(3745, 'Uchopovač FISKARS Solid 1015681 je praktický pomocník pro úklid odpadků ze stoje. Gumové zakončení snadno uchopí papír, listy, větvičky a další materiál. Uchopovač má ocelovou násadu.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(3748, 'Dvouruční nůžky převodové na silné větve FISKARS 1001555 o velikosti S jsou určené pro všechny druhy střihání v zahradě až do průměru větví 28 \nmm. Zahradní nůžky mají unikátní převod PowerGear™, který zvyšuje střižný výkon a rovnoměrně rozděluje sílu v celém průběhu střihu. Nůžky FISKARS mají patentovanou technologii PowerStep™ umožňující stříhat větve v jednom a více krocích. Rukojeť je vyrobena z kompozitního materiálu FiberComp™ zaručující vysokou pevnost, čepel z kalené nerez oceli s dlouhou trvanlivostí.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(4109, 'Jednočepelové zahradní nůžky převodové na silné větve FISKARS 1001556 o velikosti S jsou určeny pro střihání suchého a tvrdého dřeva. Mají unikátní převod PowerGear zvyšující střižný výkon. Rukojeť nůžek FISKARS je vyrobena z kompozitního materiálu FiberCompTM, střižná čepel z kvalitní CrMoV nerez oceli potažené PTFE pro snížení tření.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(4110, 'Nůžky převodové \nna silné větve FISKARS 1001553 o velikosti L umožňují přesné stříhání i špičkami čepelí. Rukojeti nůžek FISKARS jsou vyrobeny z polyamidu vyztuženého skelnými vlákny, čepel ze švédské oceli je potažena vrstvou PTFE pro snížení tření. Maximální průměr větví pro střih je 28 mm.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5350, 'Set Fiskars je limitovanou edicí obsahující sekeru Fiskars A6, ostřič Fiskars Xsharp, bílé \nzahradní rukavice, to celé zabalené v papírové tubě.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5900, 'Štípací \nklín FISKARS 120010 je určen ke štípání \nobtížných a sukovitých špalků. Klín FISKARS je vyroben z kované oceli, přičemž je však \nvelmi lehký.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5901, 'Štípač špalků FISKARS 1001617 je určený \npro účinné a bezpečné štípání \nšpalků bez velké námahy. Hmotnost štípače je nastavitelná, a to díky odnímatelnému závaží. Klín štípače je kalený a tyč ocelová a velmi masivní. S pomocí štípače se při práci nehrbíte, záda zůstávají stále rovná a snižuje se tak celková únava. Štípač špalků je přesným nástrojem, který vylučuje promáchnutí způsobené minutím špalku čepelí.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5902, 'Lopatka s obracákem FISKARS WoodXpert 1015438 o velikosti M je určená pro výpomoc při kácení kmenů střední \nvelikosti, ale také slouží jako podpora při řezání polen nebo jejich přenášení. Pracovní \nčást lopatky FISKARS je výkovek z kalené oceli. Má \nlehkou a přitom masivní násadu vyrobenou ze speciální pevné oceli. Lopatka je vybavena objímkou pro upevnění háku na klády, který je součástí balení.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5903, 'Lopatka s obracákem FISKARS WoodXpert 1015439 o velikosti L je určená pro výpomoc při kácení kmenů střední \nvelikosti, ale také slouží jako podpora při řezání polen nebo jejich přenášení. Pracovní \nčást lopatky FISKARS je výkovek z kalené oceli. Má \nlehkou a přitom masivní násadu vyrobenou ze speciální pevné oceli. Lopatka je vybavena objímkou pro upevnění háku na klády, který je součástí balení.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5905, 'Velký a rovný rýč FISKARS Xact 1003681 je velmi odolný nástroj, který snadno proniká do půdy. Rýč má malou hmotnost a ergonomický design. Čepel rýče je ostrá, lehká a pevná. Nášlapná hrana má navíc protiskluzovou úpravu. Dlouhá násada vám zaručí pohodlnou práci a méně namáhaná záda. Rýč FISKARS je vhodný pro osoby vysoké 175 až 195 cm.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5906, 'Rýč špičatý malý FISKARS Xact 1003684 je nejlepší nástroj pro rytí v tvrdé a kamenité zemině. Rýč má naostřenou špičatou pracovní část s nášlapnou plochou, která snadno proniká vrstvami půdy a seká kořeny. Rýč FISKARS je vhodný pro uživatele 160 - 175 cm \nvysoké.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5907, 'Rýč špičatý velký FISKARS \nXact 1003683 je výborný nástroj pro rytí v tvrdé a kamenité půdě. Rýč má naostřenou \npracovní část s nášlapnou plochou. Velmi snadno proniká vrstvami půdy a seká kořeny. Je vhodný pro uživatele vysoké 175 až 195 cm. Při práci s rýčem FISKARS oceníte méně namáhaná záda.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5908, 'Rýč rovný malý FISKARS Xact 1003682 je výborný \nnástroj pro rytí v klasické zahradní zemině. Rýč má naostřenou pracovní část s nášlapnou plochou. Snadno proniká vrstvami půdy a seká kořeny. Je vhodný pro uživatele vysoké 160 až 175 cm. \nPři práci oceníte méně namáhané záda.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5909, 'Vidle střední FISKARS Xact 1003686 jsou výborným nástrojem na rytí \na obracení zhutněné půdy. Slouží také pro pohodlné přemisťování drnů, sázení, provzdušňování trávníků, vyhrabavání kamenů a plevele. Hroty vidlí FISKARS velmi snadno proniknou do země a nezarazí se o kameny, plevel ani kořeny. Jsou určeny pro uživatele vysoké 160 až 175 cm.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5910, 'Vidle velké FISKARS Xact 1003685 jsou výborným nástrojem na rytí a obracení zhutněné půdy. Slouží také pro pohodlné přemisťování drnů, sázení, provzdušňování trávníků, vyhrabavání kamenů a plevele. Mají ergonomický design a kvalitní hroty, které velmi snadno proniknou do země a nezarazí se o kameny, plevel ani kořeny. Vidle FISKARS jsou určeny pro uživatele o výšce 175 až 195 cm.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5911, 'Vidle kompostové velké FISKARS Xact 1003687 jsou výborným nástrojem na manipulaci se senem, trávou, plevelem, kompostem \na dalším zahradním odpadem. Vidle mají tenké a ostré hroty, které jsou od sebe více vzdálené a zakřivené, díky čemuž se lépe zapichují \na materiál mezi nimi neulpívá. Vidle FISKARS mají ergonomický design a jsou velmi lehké. Práce s nimi nevysiluje a přespříliš nenamáhají záda.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5912, 'Hrábě na listí FISKARS Solid XL 1015645 mají extra široký záběr pro co nejrychlejší shrabání \nvelké plochy trávníku. Hrábě jsou velmi lehké \na trvanlivé konstrukce. Násada je vyrobena z hliníku a má závěsné očko pro zavěšení nářadí v době nečinnosti. Hrábě FISKARS mají \n27 plochých, tuhých a zakřivených prstů, které zabraňují podklouznutí hrabanému listí. Jedná se o vysoce kvalitní zahradní nástroj, který vám dlouho vydrží a jen tak vás nezklame.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5913, 'Motyčka FISKARS Solid 1016035 je určená k provzdušnění a překopání půdy před setbou, urovnání záhonů, shrabování větví nebo mulčování. Násada motyčky je vyrobena z hliníku, pracovní část z kvalitní karbonové oceli.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5914, 'Kultivátor FISKARS Solid 1016034 skvěle slouží k odstraňování plevele mezi řádky a rostlinami nebo k rozbití ztvrdlé půdy \npro kultivaci. Čepel kultivátoru je zhotovena z kvalitní kalené karbonové oceli, násada z hliníku.', NULL, NULL, '2021-07-19 09:55:02', '2021-07-19 09:55:02'),
	(5915, 'Hrábě FISKARS Solid 1016036 jsou víceúčelové hrábě pro přípravu půdy před setbou, urovnávání záhonů, shrabování větví nebo mulčování. Pracovní část hrábí je z kalené karbonové oceli, násada z hliníku.', NULL, NULL, '2021-07-19 09:55:03', '2021-07-19 09:55:03'),
	(6035, 'Lopata velká FISKARS Xact 1003688 má širokou pracovní část a je vhodná pro \nmanipulaci se sypkým materiálem, např. s pískem, hlínou, sněhem apod. Zahnutá část lopaty FISKARS napomáhá lepší stabilitě. Je použitelná pro všechny výšky.', NULL, NULL, '2021-07-19 09:55:03', '2021-07-19 09:55:03'),
	(6337, 'Štípací sekera FISKARS X21 - L 1015642 se nezastaví před žádným špalkem a bez větších problémů si poradí i s velkými kusy dřeva. Díky své unikátní konstrukci vám ušetří mnoho sil a je možné s ní pracovat dlouhou dobu bez zbytečné únavy zad a paží.', NULL, NULL, '2021-07-19 09:55:03', '2021-07-19 09:55:03'),
	(6343, 'Zarovnávač trávníků FISKARS Solid \n1011617 je vynikající pro vytváření rovných \nokrajů trávníků nebo záhonů s rostlinami. Čepel i násada jsou vyrobené z velmi kvalitní oceli. Robustní provedení zaručuje dlouhou výdrž.', NULL, NULL, '2021-07-19 09:55:03', '2021-07-19 09:55:03'),
	(6352, 'Sekera X5 FISKARS 1015617 je malá a praktická sekera, vhodná zejména pro trampy a stanování nebo jako malá příruční sekerka na štípání třísek. Čepel je vyrobena z vysoce kvalitní uhlíkové oceli, která se snadno brousí. Topůrko z materiálu FibreComp je vyztužené skelnými vlákny a je tak nesmírně pevné, trvanlivé a lehké. Konec je potažený Elastomerem pro co nejpohodlnější uchopení. Sekera je dodávána s ochranným pouzdrem.', NULL, NULL, '2021-07-19 09:55:03', '2021-07-19 09:55:03'),
	(6353, 'Sekera FISKARS X7 1015618  je určena především pro tesaře, outdoor aktivity, také do auta, na loď, nebo na chatu. Pro její malou váhu je možné ji nosit neustále u sebe. Topůrko je vyrobeno z ultra lehkého a odolného materiálu FiberComp ™, který minimalizuje únavu a dělá sekeru prakticky nerozbitnou. Zahnutý \nkonec rukojeti zabraňuje sklouznutí sekery a předchází tak případným nehodám. Sekera je dodávána s plastovým pouzdrem pro snadné přenášení a skladování.', NULL, NULL, '2021-07-19 09:55:03', '2021-07-19 09:55:03'),
	(6354, 'Sekera X10 FISKARS 1015619 je ideálním pomocníkem pro truhlářství a práce se dřevem. Topůrko je vyrobeno z ultra lehkého a odolného materiálu FiberComp ™, který minimalizuje únavu a dělá sekeru prakticky nerozbitnou. Zahnutý konec rukojeti zabraňuje sklouznutí sekery a předchází tak případným nehodám. Sekera je dodávána s plastovým pouzdrem pro snadné přenášení a skladování.', NULL, NULL, '2021-07-19 09:55:03', '2021-07-19 09:55:03'),
	(6355, 'Štípací sekera X11 - S FISKARS 1015640 je určena k štípání malých špalků a větví. Použitelná také jako jednoruční sekera. Je vyrobena z velmi odolného materiálu a vydrží po velmi dlouhou dobu.', NULL, NULL, '2021-07-19 09:55:03', '2021-07-19 09:55:03'),
	(6356, 'Štípací sekera X17 - M FISKARS 1015641 střední velikostí je určena k štípání středních \na větších špalků. Díky své unikátní konstrukci skvěle štípe dřevo a je tak výborným pomocníkem na zahradě při přípravě dřeva. Topůrko ze skelných vláken spojené kompozitně s hlavou zajišťuje maximální odolnost proti poškození.', NULL, NULL, '2021-07-19 09:55:03', '2021-07-19 09:55:03'),
	(6357, 'Štípací sekera X25 - XL FISKARS 1015643 se nezastaví před žádným špalkem a bez větších problémů s ní naštípáte i ty největší kusy dřeva. Je předurčena na zpracování velkého množství dřeva například na dlouhou zimní sezónu. Díky své unikátní konstrukci vám ušetří mnoho sil a je možné s ní pracovat dlouhou dobu bez zbytečné únavy zad a paží.', NULL, NULL, '2021-07-19 09:55:03', '2021-07-19 09:55:03'),
	(6358, 'Štípací sekera X27 - XXL FISKARS 1015644 4. generace se nezastaví před žádným špalkem a bez větších problémů s ní naštípáte i ty největší kusy dřeva. Je jako dělaná pro zpracování velkého množství dřeva na dlouhou zimní sezónu. Díky svojí unikátní konstrukci vám ušetří mnoho sil a je možné s ní pracovat dlouhou dobu bez zbytečné únavy zad a paží.', NULL, NULL, '2021-07-19 09:55:03', '2021-07-19 09:55:03'),
	(7553, '', NULL, NULL, '2021-07-19 09:55:03', '2021-07-19 09:55:03');
